INSERT INTO `dl_article` (`id`, `title`, `cate`, `origin`, `comment`, `view`, `collection`, `content`, `picture`, `video`, `is_recommend`, `create_at`) VALUES
(15, '《微生物篇》—细菌的结构与生理（一）', 2, '微信公众号：泽成兽医学苑', 17, 2043, 33, '<p><strong>细菌：</strong>原核生物界中的一大类单细胞微生物，多以二分裂方式进行无性繁殖，利用生化反应试验可以鉴别不同种类的细菌，细菌的大小介于动物细胞与病毒之间，以微米（μm）为测量单位。<br/><strong>（一）、细菌的形态</strong><br/><strong>分类（个体）：</strong>球菌、杆菌、螺形菌。<br/><strong>球菌：</strong>双球菌、链球菌、葡萄球菌。<br/><strong>杆菌：</strong>棒状杆菌、球杆菌、分支杆菌。<br/><strong>螺形菌</strong>（菌体弯曲或螺旋状）：弧菌和螺菌。</p><p><img alt=\"\" src=\"http://47.98.148.110/zcjy/public/uploads/ck_img/20180406/e9e91b1e606fb57dd3800ee74a42068d.jpg\"/></p><p>细菌的形态易受环境因素的影响，在适宜条件下培养8~18h的形态较为典型。<br/><strong>菌落：</strong>在适宜的固体培养基中，适宜条件下经过一定时间培养（18~24h），细菌在培养基表面或内部分裂增殖形成大量菌体细胞，形成肉眼可见的、有一定形态的独立群体。<br/><strong>菌苔：</strong>若菌落连成一片。<br/><strong>炭疽杆菌：</strong>边缘呈卷发状。<br/><strong>（二）、细菌的基本结构</strong></p><p><img alt=\"\" src=\"http://47.98.148.110/zcjy/public/uploads/ck_img/20180406/e514cbe56b27960b57448906e4520258.jpg\"/><br/><strong>1.细胞壁：</strong>细菌最外层结构，紧贴于细胞膜之外，坚韧而有弹性。<br/>细菌细胞壁的化学组成比较复杂，以革兰氏染色可将细菌分为革兰氏阳性菌和革兰氏阴性菌两大类。<br/><strong>（1）.革兰氏阳性菌细胞壁：</strong>细胞壁厚，结构简单，由肽聚糖和磷壁酸组成，肽聚糖由聚糖骨架、四肽侧链、五肽交联桥三部分组成。磷壁酸是革兰氏阳性菌细胞壁的特有成分，分为膜磷壁酸和壁磷壁酸。<br/>（<strong>2）.革兰氏阴性菌细胞壁：</strong>细胞壁薄，结构复杂，无五肽交联桥，外膜由外膜蛋白、脂质双层和脂多糖三部分组成，脂多糖由类脂A、核心多糖、特异性多糖组成。类脂A是内毒素的主要毒性成分，能导致动物体发热、白细胞增多，甚至休克、死亡。周浆间隙作用获得营养、解除有害物质毒素等。<br/><strong>（3）.细胞壁作用：</strong>维持细菌的固有形态，保护细菌抵抗低渗环境；与细胞的致病性有关；携带多种抗原决定簇；与细胞内、外物质交换有关。<br/><strong>（4）.L型细菌：</strong>将细胞壁缺陷型的细菌称为L型细菌。<br/><strong>2.细胞膜：</strong>位于细胞壁内侧，紧密包绕着细胞质，是一层富有弹性及半渗透性生物膜。<br/>细胞膜功能：选择通透性；有多种呼吸酶；分泌胞外酶；有多种合成酶类，是细菌细胞生物合成的场所。<br/>3.细胞质：细胞膜所包围了、除核体以外的所有物质，是细菌新陈代谢的主要场所。<br/><strong>（1）.核糖体</strong>：由RNA和蛋白质组成。<br/><strong>（2）.质粒：</strong>基因组DNA以外的闭合环状双股DNA分子。<br/>F质粒：致育性；<br/>R质粒：耐药性；<br/>毒力质粒：致病性。<br/><strong>4.核体（拟核）：</strong>细菌的染色体，由裸露的双链DNA堆积而成，是细菌遗传变异的物质基础。<br/><strong>（三）、细菌的特殊结构</strong><br/>1.荚膜：大多数细菌的荚膜为多糖，少数为多肽，还有一些为透明质酸。功能：保护细菌抵御吞噬细胞的吞噬；具有特异的抗原性。<br/>2.鞭毛：鞭毛成分是蛋白质，分为单毛菌、双毛菌、丛毛菌、周毛菌四种，功能：菌体运动（半固体培养基穿刺）；具有特异的抗原性；与细菌的黏附有关。</p><p><br/><strong>3.菌毛：</strong>化学成分为蛋白质，分为普通菌毛和性菌毛。<br/><strong>普通菌毛：</strong>黏附。<br/><strong>性菌毛：</strong>与接合和转移有关。<br/>注：其中2型为性菌毛，其余为普通菌毛。<br/><strong>4.芽孢</strong>：抵抗不良环境的休眠结构，杀灭芽孢的可靠方法160℃干热灭菌或高压蒸汽灭菌，炭疽杆菌的芽孢为卵圆形，破伤风杆菌的芽孢为圆形。<br/><strong>（四）、细菌的染色方法</strong><br/><strong>1.革兰氏染色法：</strong>分为革兰氏阳性菌（紫色）和革兰氏阴性菌（红色）。其方法：草酸胺结晶紫（1min）、革兰氏碘液（1min）、95％乙醇脱色（30S）、石炭酸复红或沙黄（1min）。</p><p><img alt=\"\" src=\"http://47.98.148.110/zcjy/public/uploads/ck_img/20180406/257ed1a28ab4d22c1cce891c2b0ef042.jpg\"/></p><p><strong>2.瑞氏染色法：</strong>细菌染成蓝色，组织细胞的胞浆呈红色，细胞核呈蓝色。<br/><strong>3.抗酸染色法：</strong>抗酸菌呈红色，非抗酸菌呈蓝色。<br/><strong>4.芽孢染色法：</strong>菌体红色，芽孢绿色。<br/><strong>5.荚膜染色法：</strong>有荚膜的菌，菌体蓝色，荚膜不着色，背景蓝紫色；无荚膜的菌，菌体蓝色，背景蓝紫色。<br/><strong>6.鞭毛染色法：</strong>菌体和鞭毛为深褐色到黑色。<br/><strong>（五）、细菌的生长繁殖</strong><br/><strong>1.基本条件：</strong><br/>（1）.营养物质：水分、碳源、氮源、无机盐、生长因子。<br/>（2）.酸碱度：大多数细菌最适PH为7.2~7.6。<br/>（3）.温度：大多数病原菌的最适生长温度为37℃，嗜冷菌，最适生长温度为10~20℃；嗜温菌，最适生长温度为20~40℃；嗜热菌，最适生长温度为50~60℃。<br/>（4）.气体：专性需氧菌，微需氧菌，专性厌氧菌，兼性厌氧菌。<br/>（5）.渗透压: 等渗。<br/><strong>2.细菌的生长曲线：</strong>以培养时间为横坐标，活菌数的对数为纵坐标。<br/><strong>（1）.迟缓期：</strong>菌体增大，代谢活跃，细菌数不增加。<br/><strong>（2）.对数期：</strong>活菌数呈对数直线上升，对抗生素敏感。<br/><strong>（3）.稳定期</strong>：活菌数和死菌数大致平衡。<br/><strong>（4）.衰亡期：</strong>死菌数超过活菌数。</p><p><img alt=\"\" src=\"http://47.98.148.110/zcjy/public/uploads/ck_img/20180406/080ea2b60bc0bf1647d1213abfbb2ca0.jpg\"/><br/><strong>小试牛刀</strong><br/><strong>1.属于细菌基本结构的是（ ）</strong><br/>A.鞭毛&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B.荚膜&nbsp;&nbsp; C.菌毛<br/>D.核体&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; E.芽孢<br/><strong>2.细菌抵抗不良环境的特殊存活形式是（ ）</strong><br/>A.芽孢&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B.荚膜&nbsp;&nbsp; C.菌毛<br/>D.鞭毛&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; E.细胞膜<br/><strong>3.细菌生长繁殖过程中对抗生素最敏感的时期是（ ）</strong><br/>A.对数期&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B.迟缓期<br/>C.稳定期&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; D.衰亡晚期<br/>E.衰亡早期<br/><strong>4.细菌在固体培养基上培养，通过肉眼可观察到的是（ ）</strong><br/>A.菌体形态&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B.菌体大小<br/>C.菌体排列&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; D.菌体集落<br/>E.菌体结构<br/><strong>5.革兰氏阳性菌细胞壁特有的组分是（ ）</strong><br/>A.脂质&nbsp;&nbsp;&nbsp;&nbsp; B.脂多糖&nbsp;&nbsp; C.磷壁酸<br/>D.肽聚糖&nbsp;&nbsp; E.蛋白质<br/><strong>6.细菌抵御动物吞噬细胞吞噬的结构是（ ）</strong><br/>A.荚膜&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B.鞭毛&nbsp;&nbsp; C.芽孢<br/>D.性菌毛&nbsp;&nbsp;&nbsp; E.普通菌毛<br/><strong>7.细菌的繁殖方式是（ ）</strong><br/>A.芽殖&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B.复制&nbsp;&nbsp; C.掷孢子<br/>D.二分裂增殖&nbsp;&nbsp; E.产生芽孢子<br/><strong>8.在固体培养基上可生长成大而扁平，边缘呈卷发状菌落的细菌是（ ）</strong><br/>A.大肠杆菌&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B.炭疽杆菌<br/>C.金黄色葡萄球菌&nbsp;&nbsp;&nbsp; D.多杀性巴氏杆菌<br/>E.产单核细胞李氏杆菌<br/><strong>9.L 型细菌与其原型菌相比，差异的结构是（ ）</strong><br/>A.核体&nbsp;&nbsp;&nbsp;&nbsp; B.质粒&nbsp;&nbsp;&nbsp; C.细胞膜<br/>D.核糖体&nbsp;&nbsp; E.细胞壁<br/><strong>10.抗酸染色后呈红色的细菌是（ ）</strong><br/>A.大肠杆菌&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B.猪链球菌<br/>C.炭疽杆菌&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; D.结核分支杆菌<br/>E.多杀性巴氏杆菌<br/><strong>11.细菌群体生长过程中，新繁殖的活菌数与死菌数大致平衡的生长时期是（ ）</strong><br/>A.静止期&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B.迟缓期&nbsp;&nbsp;&nbsp; C.对数期<br/>D.稳定期&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; E.衰亡期<br/><strong>12.螺形菌大小的度量单位是（ ）</strong><br/>A.分米（dm）&nbsp;&nbsp; B.厘米(cm)&nbsp; C.毫米(mm)<br/>D.微米(um)&nbsp;&nbsp; E.纳米(nm)<br/><strong>13.具有抗吞噬作用的细菌结构是（ ）</strong><br/>A.细胞壁&nbsp;&nbsp;&nbsp; B.芽孢&nbsp;&nbsp; C.荚膜<br/>D.菌毛&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; E.鞭毛<br/><strong>14.细菌细胞中含量最多的物质是（ ）</strong><br/>A.无机盐&nbsp;&nbsp;&nbsp; B.蛋白质&nbsp;&nbsp; C.糖类&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br/>D.脂类&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; E.水<br/><strong>15.维持细菌固有形态的结构是（ ）</strong><br/>A.S 层&nbsp;&nbsp;&nbsp;&nbsp; B.拟核&nbsp; C.细胞壁<br/>D.细胞膜&nbsp;&nbsp; E.细胞质<br/><strong>16.具有抗吞噬作用的细菌结构是（ ）</strong><br/>A.质粒&nbsp;&nbsp; B.荚膜&nbsp;&nbsp; C.鞭毛<br/>D.菌毛&nbsp;&nbsp; E.芽孢<br/><strong>17.细菌群体生物特性最典型的生长时期是（ ）</strong><br/>A.潜伏期&nbsp;&nbsp; B.迟缓期&nbsp;&nbsp; C.对数期<br/>D.稳定期&nbsp;&nbsp; E.死亡期<br/><strong>18.细菌染色体以外的遗传信息存在于(&nbsp; )</strong><br/>A.细胞壁&nbsp;&nbsp;&nbsp; B.细胞膜&nbsp; C.质粒&nbsp;<br/>D.核糖体&nbsp;&nbsp; E.核体<br/><strong>19.具有完整核质与酶系统的细菌结构是(&nbsp; )</strong><br/>A.荚膜&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B.鞭毛&nbsp;&nbsp; C.性菌毛<br/>D.普通菌毛&nbsp;&nbsp; E.芽孢<br/><strong>20.细菌群体生长过程中，对抗菌药物最敏感的时期是(&nbsp; )</strong><br/>A.静止期&nbsp;&nbsp; B.迟缓期&nbsp; C.对数期<br/>D.稳定期&nbsp;&nbsp; E.衰亡期<br/><strong>21.细菌在固体培养基上生长形成的菌落连成一片,称为(&nbsp; )</strong><br/>A.菌丝&nbsp;&nbsp; B.菌膜&nbsp;&nbsp; C.菌苔<br/>D.菌团&nbsp;&nbsp; E.菌膜团<br/><strong>22.革兰氏阳性菌细胞壁特有的组分是(&nbsp; )</strong><br/>A.蛋白质&nbsp;&nbsp;&nbsp; B.脂质&nbsp; C.脂多糖<br/>D.磷壁酸&nbsp;&nbsp;&nbsp; E.肽聚糖<br/><strong>23.与细菌黏附细胞有关，只能在电子显微镜下观察到的结构是(&nbsp; )</strong><br/>A.普通菌毛&nbsp;&nbsp; B.性菌毛&nbsp; C.鞭毛<br/>D.荚膜&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; E.芽孢<br/><strong>24.必须在无氧条件下才能生长繁殖的细菌是(&nbsp; )</strong><br/>A.大肠杆菌&nbsp;&nbsp;&nbsp;&nbsp; B.炭疽芽孢杆菌<br/>C.破伤风梭菌&nbsp;&nbsp; D.伤寒沙门氏菌<br/>E.金黄色葡萄球菌<br/><strong>25.细菌经瑞氏染色后的菌体颜色是（ ）</strong><br/>A.红色&nbsp;&nbsp;&nbsp; B.蓝色&nbsp;&nbsp; C.紫色&nbsp;<br/>D.绿色&nbsp;&nbsp;&nbsp; E.黄色</p><p><strong>答案：</strong><br/><strong>1-5 D、A、A、D、C&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br/>6-10 A、D、B、E、D<br/>11-15 D、D、C、E、C&nbsp;&nbsp;&nbsp;<br/>16-20 B、C、C、E、C<br/>20-25 C、D、A、C、B</strong></p>', 'cate_img/20180412\\58f95977f4b369d82d7c1dc4ec844b2a.jpg', '', 0, '2018-04-05 16:46:51'),
(16, '《微生物篇》—消毒与灭菌', 2, '微信公众号：泽成兽医学苑', 22, 1789, 19, '<p><br/><strong>1.基本概念：</strong><br/>（1）.消毒：杀灭物体上病原微生物的方法，但并不一定杀死含芽孢的细菌。<br/><img alt=\"\" src=\"http://47.98.148.110/zcjy/public/uploads/ck_img/20180406/d48154689e9a0215ad3d84f2f816757b.jpg\"/></p><p>（2）.灭菌：杀灭物体上所有病原微生物和非病原微生物及其芽孢的方法。</p><p><img alt=\"\" src=\"http://47.98.148.110/zcjy/public/uploads/ck_img/20180406/cc0a8116bdc20fd73201e83c20c4f838.jpg\"/><br/>（3）.无菌：物体上、容器内或特定的操作空间内没有活微生物的状态。<br/>（4）.防腐：阻止或抑制物品上微生物生长繁殖的方法，微生物不一定死亡。血清中添加硫柳汞的目的是防腐。<br/><strong>2.物理消毒灭菌法：</strong><br/>（1）.高压蒸汽灭菌法：103.4kPa，121.3℃，15~30min，杀死芽孢在内的所有微生物。适用于耐高温和不怕潮湿物品的灭菌，如培养基、玻璃器皿、手术器械、注射器、生理盐水等。<br/>（2）.煮沸法：100℃，5min，杀死繁殖体，1~3h，杀死芽孢，水中加入2％碳酸钠提高沸点至105℃，杀死芽孢，防止生锈。<br/>（3）.流通蒸汽法：100℃，30min，杀死繁殖体，适用于含糖或含血清培养基的灭菌。<br/>（4）.巴氏消毒法：适用于牛乳、葡萄酒、啤酒等食品的消毒。<br/>低温维持法：63~65℃，30min；<br/>高温瞬时法：71~72℃，15s；<br/>超高温法：132℃，1~2s。<br/>（5）.紫外线：波长200~300nm具有杀菌作用，以波长265~266nm的杀菌能力最强。紫外线的杀菌原理主要是破坏细菌的DNA。</p><p><img alt=\"\" src=\"http://47.98.148.110/zcjy/public/uploads/ck_img/20180406/410522dcaebe6cfb19d9d6ff2ac16524.jpg\"/><br/>3.化学消毒法：<br/>（1）.醛类：熏蒸消毒，适用于室内、器具的消毒，每立方米空间用甲醛溶液20mL加等量水，加热使甲醛变为气体；2％水溶液消毒，每100㎡ 13mL。<br/>（2）.醇类：75％乙醇。<br/>（3）.含碘消毒剂：2％的碘酊，0.3％~0.5％的碘伏。<br/>（4）.季铵盐类：具有杀菌和去污作用使用浓度为0.1％~0.2％。<br/>（5）.带畜禽消毒的消毒药：0.1%苯扎溴铵、0.3%过氧乙酸、0.1%次氯酸钠.</p><p><img alt=\"\" src=\"http://47.98.148.110/zcjy/public/uploads/ck_img/20180406/2cf3f68ab89d46a3f02a04a65437e0a5.jpg\"/></p><p>小试牛刀<br/>1．采用 0.22um 孔径滤膜过滤小牛血清的目的是（&nbsp; ）<br/>A、防腐&nbsp;&nbsp; B、消毒&nbsp;&nbsp; C、抑菌<br/>D、除菌&nbsp;&nbsp; E、杀菌<br/>2．耐热橡胶制品最适的灭菌方法是（&nbsp; ）<br/>A、焚烧&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; B、γ射线照射<br/>C、紫外线照射 D、热空气灭菌<br/>E、高压蒸汽灭菌<br/>3．种蛋室空气消毒常用的方法是（&nbsp; ）<br/>A、紫外线&nbsp;&nbsp; B、α射线&nbsp;&nbsp; C、β射线<br/>D、γ射线&nbsp;&nbsp; E、X 射线<br/>4．超高温巴氏消毒法采用的温度是（&nbsp; ）<br/>A、160℃&nbsp; B、132℃&nbsp; C、121℃<br/>D、100℃&nbsp; E、72℃<br/>5．常用于畜舍熏蒸消毒的消毒剂是(&nbsp;&nbsp; )<br/>A、来苏儿&nbsp;&nbsp;&nbsp; B、新洁尔灭&nbsp; C、季胺盐&nbsp;<br/>D、福尔马林&nbsp; E、氢氧化钠<br/>6．适用巴氏消毒法进行消毒的是(&nbsp;&nbsp; )<br/>A、培养基&nbsp;&nbsp;&nbsp; B、生理盐水&nbsp; C、玻璃器皿<br/>D、手术器械&nbsp; E、牛奶<br/>7．乙醇消毒常用的浓度为(&nbsp; )<br/>A、100%&nbsp;&nbsp; B、95%&nbsp;&nbsp; C、85%<br/>D、75%&nbsp;&nbsp;&nbsp; E、65%<br/>8．实验室空气消毒常用的方法是(&nbsp;&nbsp; )<br/>A、紫外线照射 B、α射线照射<br/>C、β射线照射 D、γ射线照射<br/>E、 X 射线照射<br/>9．血清中加0.01%硫柳汞的目的是（&nbsp; ）<br/>A.消毒&nbsp;&nbsp;&nbsp;&nbsp; B.灭菌&nbsp;&nbsp;&nbsp; C.防腐&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br/>D.杀菌&nbsp;&nbsp;&nbsp;&nbsp; E.无菌<br/>10. 乳品和酒类适用的灭菌方法是（&nbsp; ）<br/>A、高压蒸汽灭菌法&nbsp;&nbsp;&nbsp;&nbsp; B、煮沸法<br/>C、巴氏消毒法&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; D、流通蒸汽法<br/>E、火焰灭菌法</p><p><strong>答案：</strong></p><p><strong>1—5D、E、A、B、D<br/>2—10E、D、A、C、C</strong></p>', 'cate_img/20180412\\c3ea6034a92f12252156c933c94f4493.jpg', '', 1, '2018-04-06 09:30:44'),
(18, '上传图片', 1, '秋秋', 0, 0, 0, '<p><img src=\"http://padmin.com//uploads/ue/20180412\\ccf6bfe296a2bfa8af3f1972b9141c44.jpg\" title=\"ccf6bfe296a2bfa8af3f1972b9141c44.jpg\"/></p><p><img src=\"http://padmin.com//uploads/ue/20180412\\07f76878f2993d32b4db4edecebb16af.png\" title=\"07f76878f2993d32b4db4edecebb16af.png\" width=\"300\" height=\"300\" alt=\"07f76878f2993d32b4db4edecebb16af.png\"/></p><p><br/></p>', 'cate_img/20180412\\d179aa45eb58baab3fb84ccab6e102b5.jpg', '', 0, '2018-04-12 06:54:46');
